import React from 'react';
import Header from './Header'
import Team from './Team'

function App() {
  return (
    <div className='container'>
      <audio autoPlay>
        <source src='gameOfThrones.mp3' type='audio/mpeg'></source>
      </audio>
      <Header />
      <Team />
    </div>
  );
}

// تصدير الدالة
export default App;
